window.bookSummaryJSON = "<p>Death isn't so bad if it means saving the universe. </p> <p>Samantha was badass even before she learned magic. Fending for herself in the cauldron of a planet torn apart by an alien invasion taught Samantha how to kill. Ruthlessly efficient, her abilities have caught the attention of the Shadow Corps. </p> <p>A group comprised of deadly warriors who focus on galactic safety, using any means necessary. </p> <p>A battle-hardened warlord causing you trouble? The Shadow Corps will ruin their day. </p> <p>Her first mission puts her team up against a space dragon, death reapers, and the ultimate sorcerer. </p> <p>Samantha had better learn to master her alien magic, or be forced to watch her world, and many others, burn. </p> <p>A Seppukarian universe series for fans of <i>Destiny</i> and <i>Warhammer 40K</i>. </p> <p>Note: For fans of LitRPG who like level-ups and skill trees without being in a video game. </p>"; 
